import React,{Component} from 'react';
import {TopicWidget} from '../style';
class Topic extends Component{
    render(){
        return (
            <TopicWidget>
                <TopicItem>
                    <img src='' alt=''/>

                </TopicItem>
            </TopicWidget>
        )
    }
}   
export default Topic;
